import { Form, Icon, Input, Button } from 'antd';
import React, { Component } from "react";



class child extends Component {
    render() {
        return (
            <div>
                <div >I am Child</div>
                <input type="text"
                 placeholder="Write text" onChange={(e) => this.props.updateTextCB(e.target.value)} />
            </div>
        )
    }
}

export default child;
